import React from "react";
import { Switch, Route } from "react-router-dom";
import Cart from "./Cart";

const CartPage = () => {

    return(
        <Switch>
            <Route exact path="/cart">
                <Cart />
                <p>1</p>
            </Route>
        </Switch>
    )
}

export default CartPage;
